import { Formik, Form, Field } from 'formik';
import Button from '../../components/utils/button/button';
import Input from '../../components/utils/regex/input';
import schema from '../../components/validates/schema';
import './style.css';


export default function Register() {


  function onSubmit(values, actions) {

    console.log('SUBMIT', values);

  }
  function validate(values) {
    const errors = {};
    if (!values.phoneOne) {
      errors.phoneOne = "Telefone é obrigatório";
    }if (!values.crm) {
      errors.crm = "Crm é obrigatório";
    }if (!values.cpf) {
      errors.cpf = "Cpf é obrigatório";
    }if (!values.specialization) {
      errors.specialization = "Especialização é obrigatório";
    }if (!values.name) {
      errors.name = "Nome é obrigatório";
    }if (!values.email) {
      errors.name = "Email é obrigatório";
    }
    return errors;
  }
    return (

      <div className={"Principal"}>

        <div> <a href="/"><img src="https://i.imgur.com/tDvwyyA.png" className={'logo'} title="source: imgur.com" /></a></div>
        <h1>Cadastro</h1>
        <h2>Preencha as Informações abaixo</h2>
        <br></br>
        <br></br>
        <Formik

          validationSchema={schema}
          validate={validate}
          onSubmit={onSubmit}
          initialValues={{
            nome: '',
            email: '',
            cpf: '',
            crm: '',
            specialization: '',
            phoneOne: '',
            phoneTwo: '',
            password: '',
          }}
          render={({ values, errors, isValid }) => (

            <Form className={"divCenter"}>
              <div >
                <label className={"text"}>Nome</label>
                <br></br>
                <Input name="name" type="text" />
                <br></br>
                {errors.name && (
                  <span className={'errors'}>{errors.name}</span>
                )}
              </div>
              <br></br>
              <div>
                <label className={"text"}>Email</label>
                <br></br>
                <Input name="email" type="text" />
                <br></br>
                {errors.email && (
                  <span className={'errors'}>{errors.email}</span>
                )}
              </div>
              <br></br>
              <div>
                <label className={"text"}>CPF</label>
                <br></br>
                <Input mask="cpf" name="cpf" type="text" />
                <br></br>
                {errors.cpf && (
                  <span className={'errors'}>{errors.cpf}</span>
                )}
              </div>
              <br></br>
              <div>
                <label className={"text"}>CRM</label>
                <br></br>
                <Input mask="crm" name="crm" type="text" />
                <br></br>
                {errors.crm && (
                  <span className={'errors'}>{errors.crm}</span>
                )}
              </div>
              <br></br>
              <div>
                <label className={"text"}>Especialização</label>
                <br></br>
                <Input name="specialization" type="text" />
                <br></br>
                {errors.specialization && (
                  <span className={'errors'}>{errors.specialization}</span>
                )}
              </div>
              <br></br>
              <div>
                <label className={"text"}>Telefone</label>
                <br></br>
                <Input mask="telefone" name="phoneOne" type="text" />
                {errors.phoneOne && (
                  <span className={'errors'}>{errors.phoneOne}</span>
                )}

              </div>

              <br></br>
              <div>
                <label className={"text"}>Senha</label>
                <br></br>
                <Input mask="password" name="password" type="password" />
                <br></br>
                <button color='btn--primary' buttonSize='btn--large' disabled={!isValid}>Enviar</button>
              </div>

            </Form>

          )}
        />

      </div>
    );
  }
